import React from 'react';
import "./logo.scss";


class Logo extends React.Component {

    render() { 
        return (
            <div className='logo'>
                <figure>
                    <img src={require('../../images/logo.png')} />
                </figure>
            </div>

        );
    }
}

export default Logo;
